61\u7528\u300c\u6211\u300d\u9019\u500b\u5b57\u7684\u4eba\u3002\n\u5728\u5beb\u5b57\u6642\u5019\uff0c\u8aaa\u51fa\u4e86\u6211\u5c31\u5f77\u5f7f\u662d\u544a\u8457\u5929\u4e0b\u3002\n-\n\u5f9e\u67d0\u523b\u958b\u59cb\uff0c\u59b3\u958b\u59cb\u767c\u73fe\u559c\u6b61\u4e0a\u5225\u4eba\uff0c\u662f\u4e00\u4ef6\u7c21\u55ae\u53c8\u56f0\u96e3\u7684\u4e8b\u60c5\u3002\u59b3\u767c\u73fe\u4e5f\u8a31\u56e0\u70ba\u5bc2\u5bde\u800c\u96a8\u610f\u5730\u611b\u3001\u958b\u59cb\u4e0d\u56e0\u6027\u5225\u6216\u4efb\u4f55\u689d\u4ef6\u800c\u611b\u3002\u56de\u982d\u770b\u7684\u6642\u5019\u7e3d\u6709\u4e9b\u610f\u5916\uff0c\u4e0a\u7db2\u4e00\u683c\u4e00\u683c\u586b\u5beb\u8457\u60f3\u5426\u8a8d\uff0c\u6700\u5f8c\u7e3d\u6703\u51fa\u73fe\u610f\u6599\u4e4b\u5167\u7684\u7d50\u679c\u3002\n\n\u67d0\u5929\u59b3\u958b\u59cb\u63a5\u53d7\u4e86\u3002\u59b3\u958b\u59cb\u77e5\u9053\u81ea\u5df1\u3001\u81f3\u5c11\u81f3\u4eca\u3001\u7121\u6cd5\u611b\u3002\u59b3\u77e5\u9053\u767c\u751f\u904e\u5f88\u591a\u7121\u4ee5\u540d\u72c0\u7684\u559c\u6b61\u4e0a\u548c\u611b\u4e0a\uff0c\u4f46\u4e5f\u5728\u90a3\u958b\u59cb\u7684\u4e00\u523b\u6e05\u695a\u770b\u898b\u51cb\u840e\u7684\u84bc\u862d\u3002\u7121\u6cd5\u958b\u59cb\u4fbf\u7070\u98db\u7159\u6ec5\u4e86\u3002\n-\n\u6211\u96e2\u958b\u4e86\u56de\u5bb6\u4e86\uff0c\u5fc3\u9084\u7559\u5728\u4e03\u5c0f\u6642\u524d\u3002\u90a3\u500b\u6700\u8fd1\u671f\u83ab\u540d\u611b\u4e0a\u7684\u6c92\u6709\u7d50\u679c\u3002\n-\nNot a fan of using the word \"I\". When writing it, it's just like telling the whole world about me. \nAt some point, you realized that being in love is simple and difficult. You might love randomly as you're lonely, love no matter what gender or restrictions. When looking back you're surprised and tried to deny it with some sort of survey. Results are predictable.\n\nYou embraced the truth someday. You know that at least till now you can't love. You know that stories happened before about love, but you see the end of it as well.\n\nI left and returned home, but left my heart 7 hours away. My recent valentine.\n\n#\u5857\u9d09 #\u5beb\u5b57 #\u62cd\u7167 #\u788e\u788e\u5ff5 #\u65e5\u8a18 #Scribbles #Mumbles #Life #Journal #\u3076\u3064\u3076\u3064 #\u624b\u5e33 #\u5199\u771f #\u8a00\u8449 #\u697d\u66f8\u304d"}}]},"shortcode":"B9w1jh_IS3X","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584294168,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/89822017_200833164517213_7436281190042204593_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=101\u0026_nc_ohc=TPvAh4PGR7cAX9Kze42\u0026oh=06a5e4f5f6d7e1a776f50848a551db53\u0026oe=5EA2A416","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"31683252443"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/89822017_200833164517213_7436281190042204593_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=101\u0026_nc_ohc=TPvAh4PGR7cAX9Kze42\u0026oh=9b247b32751673f2c614fb271191f5b6\u0026oe=5EA318A1","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/89822017_200833164517213_7436281190042204593_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=101\u0026_nc_ohc=TPvAh4PGR7cAX9Kze42\u0026oh=c747a73a2792945f2f0293b3b45f3190\u0026oe=5E9EDC06","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/89822017_200833164517213_7436281190042204593_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=101\u0026_nc_ohc=TPvAh4PGR7cAX9Kze42\u0026oh=607c99596b998d61346d49a85e41d73e\u0026oe=5EA6254C","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s320x320/89822017_200833164517213_7436281190042204593_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=101\u0026_nc_ohc=TPvAh4PGR7cAX9Kze42\u0026oh=0405f7147cc30f60bc0642bfcd392fd6\u0026oe=5E9CAEF6","config_w
